public class OrderProcessor {
    private Logger logger;

    public OrderProcessor(Logger logger) {
        this.logger = logger;
    }

    public void processOrder(String orderId, double amount) {
        try {
            logger.log("INFO", "Processing order: " + orderId + " for amount: $" + amount);

            validateOrder(orderId, amount);

            logger.log("INFO", "Order validation successful for: " + orderId);

            chargePayment(amount);

            logger.log("INFO", "Payment processed successfully for order: " + orderId);

            updateInventory(orderId);

            logger.log("SUCCESS", "Order completed: " + orderId);

        } catch (Exception e) {
            logger.logError("Order processing failed for: " + orderId, e);
            throw e;
        }
    }

    private void validateOrder(String orderId, double amount) throws Exception {
        if (amount <= 0) {
            throw new Exception("Invalid order amount");
        }
        logger.log("DEBUG", "Order validation passed for: " + orderId);
    }

    private void chargePayment(double amount) throws Exception {
        logger.log("INFO", "Attempting to charge payment: $" + amount);
        if (amount > 10000) {
            throw new Exception("Payment amount exceeds limit");
        }
    }

    private void updateInventory(String orderId) {
        logger.log("INFO", "Updating inventory for order: " + orderId);
    }
}

