public class OrderProcessor {
    private OrderValidationService orderValidationService;
    private PaymentProcessingService paymentProcessingService;
    private InventoryManagementService inventoryManagementService;
    private Logger logger;

    public OrderProcessor(Logger logger) {
        this.logger = logger;
        this.orderValidationService = new OrderValidationService(logger);
        this.paymentProcessingService = new PaymentProcessingService(logger);
        this.inventoryManagementService = new InventoryManagementService(logger);
    }

    public void processOrder(String orderId, double amount) {
        try {
            logger.log("INFO", "Processing order: " + orderId + " for amount: $" + amount);

            orderValidationService.validateOrder(orderId, amount);

            logger.log("INFO", "Order validation successful for: " + orderId);

            paymentProcessingService.chargePayment(amount);

            logger.log("INFO", "Payment processed successfully for order: " + orderId);

            inventoryManagementService.updateInventory(orderId);

            logger.log("SUCCESS", "Order completed: " + orderId);
        } catch (Exception e) {
            logger.logError("Order processing failed for: " + orderId, e);
            throw e;
        }
    }
