public interface IFileReader
{
    string Read(string filePath);
}

public class PdfReader : IFileReader
{
    public string Read(string filePath)
    {
        return $"Reading PDF content from: {filePath}";
    }
}

public class WordReader : IFileReader
{
    public string Read(string filePath)
    {
        return $"Reading Word content from: {filePath}";
    }
}

public class DocumentProcessor
{
    private readonly Dictionary<string, IFileReader> _readers;

    public DocumentProcessor()
    {
        _readers = new Dictionary<string, IFileReader>
        {
            {"pdf", new PdfReader()},
            {"word", new WordReader()}
        };
    }

    public string ProcessDocument(string filePath, string type)
    {
        if (_readers.TryGetValue(type, out var reader))
        {
            return reader.Read(filePath);
        }

        return "Unsupported format";
    }
}

